import React from 'react';
import './Header.css';

export default () => {
    return (
        <header>
            <div className="header-log">
                <a href="http://logodownload.org" target="_blank"><img src="https://logodownload.org/wp-content/uploads/2014/10/netflix-logo-5.png" alt="netflix-logo" /></a>
            </div>
        </header>
    );
}
